import React from "react";
import Ninjas from "./Ninjas";

class App extends Component() {
  state = {
    ninjas: [
      {
        name: "nihar1",
        age: 31,
        belt: "black",
        id: 1,
      },
      {
        name: "nihar2",
        age: 234234,
        belt: "safdasd",
        id: 2,
      },
    ],
  };
  render() {
    return (
      <div className="App">
        <h1>Tis working!</h1>
        <Ninjas ninjas={this.state.ninjas}></Ninjas>
      </div>
    );
  }
}

export default App;

